import './products.css';

import img1 from '../../assets/products/images/1.png';
import img2 from '../../assets/products/images/2.png';
import img3 from '../../assets/products/images/3.png';
import img4 from '../../assets/products/images/4.png';
import img5 from '../../assets/products/images/5.png';
import img6 from '../../assets/products/images/6.png';
import img7 from '../../assets/products/images/7.png';

function Products() {

    const prodcuts = [
        {
            id: "1",
            title: "Video Game",
            platforms: [img1,img2,img3,img4,img5]
        },
        {
            id: "1",
            title: "Game DLC",
            platforms: [img1,img2,img3]
        },
        {
            id: "1",
            title: "Netflix Serie",
            platforms: [img6]
        },
        {
            id: "1",
            title: "Store",
            platforms: [img7]
        }
    ];

    return (
        <div className='products'>
            <div className='prodcuts-card-wrapper'>
                <div data-augmented-ui='b-clip-xy border' className='pcw-card'>
                    <div className='pcw-card-image pcwci-1'></div>
                    <div className='pcw-card-bottom'>
                        <div className='pcwcb-headline'>Video Game</div>
                        <div className='pcwcb-platforms'>
                            <img src={img1} alt='Platform'/>
                            <img src={img2} alt='Platform'/>
                            <img src={img3} alt='Platform'/>
                            <img src={img4} alt='Platform'/>
                            <img src={img5} alt='Platform'/>
                        </div>
                    </div>
                </div>
                <div 
                    data-augmented-ui='tl-clip tr-clip br-clip bl-clip border'
                    className='pcw-learn-more'
                >
                    Learn More
                </div>
            </div>
        </div>
    )
}
export default Products;
